import Navbar from "./Navbar";
import Footer from "./Footer";
import React, {useState} from "react";

export default function Contact({viewer, setViewer}) {

    return (
        <div>
            <Navbar viewer={viewer} setViewer={setViewer} />
            <p>This is the Contact page</p>
            <Footer />
        </div>
    );
}
